import React, { Component } from "react";
import './popupStyle.css';

class Popup extends Component {
  render(){
    return(
      <>
      <div id="box" className="container" style={this.props.display}>
        <p>Hello world!</p>
      </div>
      </>
    );
  }
}

export default Popup;
